const LoginBox = () => {
    return(
        <div className="container">

            <style jsx>
                {
                    `
                    .container {
                        background: red;
                        width: 450px;
                        height: 0px;
                    }
                    
                    
                    `
                }
            </style>
        </div>
    )
}

export default LoginBox;
